import { createRouter, createWebHistory } from 'vue-router';


import CheckBalance from './components/check_balance.vue';
import DashboardComponent  from './components/DashboardComponent.vue';
import Deposit from './components/DepositComponent.vue';
import Home from './components/HomeComponent.vue';
import PayService from './components/pay_service.vue';
import RechargePhone from './components/recharge_phone.vue';
import ShowTransactions from './components/show_transactions.vue';
import SignIn from './components/sign_in.vue';
import SignUp from './components/sign_up.vue';
import TransferToCharity from './components/transfer_to_charity.vue';
import Transfer from './components/TransferComponent.vue';
import UserInfo from './components/user_info.vue';
import Withdraw from './components/WithdrawComponent.vue';

const routes = [
  { path: '/', name: 'Home', component: Home },
  { path: '/dashboard', name: 'Dashboard', component: DashboardComponent  },
  { path: '/check_balance', name: 'CheckBalance', component: CheckBalance },
  { path: '/deposit', name: 'Deposit', component: Deposit },
  { path: '/pay_service', name: 'PayService', component: PayService },
  { path: '/recharge_phone', name: 'RechargePhone', component: RechargePhone },
  { path: '/show_transactions', name: 'ShowTransactions', component: ShowTransactions },
  { path: '/sign_in', name: 'SignIn', component: SignIn },
  { path: '/sign_up', name: 'SignUp', component: SignUp },
  { path: '/transfer_to_charity', name: 'TransferToCharity', component: TransferToCharity },
  { path: '/transfer', name: 'Transfer', component: Transfer },
  { path: '/user_info', name: 'UserInfo', component: UserInfo },
  { path: '/withdraw', name: 'Withdraw', component: Withdraw },
];

const router = createRouter({
  history: createWebHistory(),
  routes,
});

export default router;
